sys_variable_value.value:
(function mergeJsonObjects(inputs, outputs) {

    var json1 = inputs.json1;
    var json2 = inputs.json2;
    var json3 = inputs.json3;
    var json4 = inputs.json4;


var mergedJson = {
    "pInObj1_inout": {}
};

var jsonStrings = [json1,json2,json3,json4];


for (var i = 0; i < jsonStrings.length; i++) {
   
    var currentJson = JSON.parse(jsonStrings[i]);
    
    for (var key in currentJson.pInObj1_inout) {
        mergedJson.pInObj1_inout[key] = currentJson.pInObj1_inout[key];
    }
}



outputs.outputobj1=JSON.stringify(mergedJson);


})(inputs, outputs);

