sys_variable_value.value:
(function execute(inputs, outputs) {
  var lifeAssrdDob=inputs.req.data.lifeAssrdInfos.dob;
  var policyHolderDob=inputs.req.data.proposerInfos.dob;
  var LAdob=lifeAssrdDob.split("/").reverse().join("/");
  var ageLfAssrd=new x_rptp_smartinte_0.moment().diff(LAdob, 'years').toString().split(".")[0];
    outputs.agela=ageLfAssrd;

  if(policyHolderDob != ""){
   var PHdob=policyHolderDob.split("/").reverse().join("/");
   var agePolicyHold=new x_rptp_smartinte_0.moment().diff(PHdob, 'years').toString().split(".")[0];
    outputs.ageph=agePolicyHold;

  }
    return outputs;
})(inputs, outputs);

