sys_variable_value.value:
(function execute(inputs, outputs) {
var ispropo = inputs.quoteReq.isProposer;

var propoType = inputs.quoteReq.isNri;

outputs.proposaltype=(propoType=="N"||propoType=="NGST")?"N":"I";

//gs.info(proposaltype + "estryetjtyhwragtdth5");

var fnameLA = inputs.request.data.lifeAssrdInfos.frstNm;
var lnameLA = inputs.request.data.lifeAssrdInfos.lstNm;
var nameLA = fnameLA+" "+lnameLA;
var dobLA =  inputs.request.data.lifeAssrdInfos.dob;
var genderLA =  inputs.request.data.lifeAssrdInfos.gender;
var addressLA =  inputs.request.data.lifeAssrdInfos.comunctnAddress.city;
var adhaarLA =  inputs.request.data.lifeAssrdInfos.adhaarNum;

var relationToProposedInsuredLA = inputs.request.data.lifeAssrdInfos.relationWithLa;

var fnamePH = inputs.request.data.proposerInfos.frstNm;
var lnamePH = inputs.request.data.proposerInfos.lstNm;
var namePH = fnamePH+" "+lnamePH;
var dobPH =  inputs.request.data.proposerInfos.dob;
var genderPH =  inputs.request.data.proposerInfos.gender;
var addressPH =  inputs.request.data.proposerInfos.comunctnAddress.city;
var adhaarPH =  inputs.request.data.proposerInfos.adhaarNum;

var relationToProposedInsuredPH = inputs.request.data.proposerInfos.relationWithLa;

var name = (ispropo=="Y") ? nameLA : namePH;
var dob = (ispropo=="Y") ? dobLA : dobPH;
var gender = (ispropo=="Y") ? genderLA : genderPH;
var address = (ispropo=="Y") ? addressLA : addressPH;
var adhaar = (ispropo=="Y") ? adhaarLA : adhaarPH;
var relation = (ispropo=="Y") ? relationToProposedInsuredLA : relationToProposedInsuredPH;

outputs.name = name;
outputs.dob = dob;
outputs.gender = gender;
outputs.adhaar = adhaar;
outputs.address = address;
outputs.relation = relation;



return outputs;

})(inputs, outputs);

